import React from 'react'
import './step2.scss'

export default function Step2({ nextStep, prevStep }) {
  return (
    <div className="step2 ">
      <h2 className='merriweather-light'>Poznajmy się zatem</h2>
      <input className='lato-light' type="text" placeholder="Imię" />
      <input type="text" placeholder="Nazwisko" />
      <input type="email" placeholder="Email" />
      <input type="tel" placeholder="Telefon" />
      <button onClick={prevStep}>Wstecz</button>
      <button onClick={nextStep}>Dalej</button>
    </div>
  );
}
